var mac_to_name  = {}

for (var i = 0; i < msg.payload.length; i++) {
    if (msg.payload[i].in_use == 1) {
        mac_to_name[msg.payload[i].mac_address] = msg.payload[i].name;
    }
}

global.set("mac_to_name",mac_to_name)

