const strFields = /status|Direction|Units|base64Data|base16Data|devAddr|deviceAddDecoded|codeRate|ID/;
const doNotInclude = /timestamp|dateStamp/

let fields = {}
for (let x in msg.payload) {
    if (!msg.payload.hasOwnProperty(x) || doNotInclude.test(x))
        continue;

    // Parse dateTime
    if (x == 'dateTime') {
        fields['time'] = Date.parse(msg.payload[x] + " UTC")
        continue;
    }

    // Include string fields as-is
    if (strFields.test(x)) {
        fields[x] = msg.payload[x];
        continue;
    }

    // Try to parse float fields
    const val = parseFloat(msg.payload[x])
    // Only include if fload field is not NaN. 
    // Otherwise, InfluxDB will reject the whole datapoint. 
    if(!isNaN(val))
        fields[x] = val
}

const tags = { 
    device_id: msg.topic.split("/")[0],
    device_name: id_lookup[msg.topic.split("/")[0]]

}

msg.measurement = msg.topic.split("/")[1];


// add logic for dealing with BME280 and BME680
if (msg.measurement == "BME280" || msg.measurement == "BME680") {
    // see https://github.com/finitespace/BME280/blob/72a11d3b7d484995eb34c6bb8533c5ceb2aa4156/src/EnvironmentCalculations.cpp
    // also https://github.com/finitespace/BME280
    fields["dewPoint"] = 243.04 * (Math.log(fields["humidity"]/100.0) + ((17.625 * fields["temperature"])/(243.04 + fields["temperature"])))/(17.625 - Math.log(fields["humidity"]/100.0) - ((17.625 * fields["temperature"])/(243.04 + fields["temperature"])));
}

msg.payload = [fields, tags];

return msg;

const S2 = global.get("S2").S2;
const LEVEL = 10;

function getS2Token(lat, lon, level) {
    var key = S2.latLngToKey(lat, lon, level);
    var id = parseInt(S2.keyToId(key)).toString(16);

    while (id.slice(-1) == "0") {
        id = id.slice(0,-1);
    }

    return id.toLowerCase();
}

divide_results = (result) => result.measurements.map(
    (measurement) => ([
        {//values
            time: Date.parse(measurement.lastUpdated),
            value: measurement.value,
        },
        {//tags
            lat: result.coordinates.latitude,
            lon: result.coordinates.longitude,
            s2_cell_id: getS2Token(result.coordinates.latitude, result.coordinates.longitude, LEVEL),
            parameter: measurement.parameter,
            country: result.country,
            city: result.city,
            location: result.location,
            unit: measurement.unit,
        }
    ])
)

is_cached = ([values, tags]) =>
    values.time
    !== cache.put(tags.location, tags.parameter, values.time)

// could drop the != null, but then it would fail for the coordinates (0,0)
has_coordinates = ({coordinates}) =>
    coordinates?.longitude != null && coordinates?.latitude != null

msg.payload = msg.payload.results
    .filter(has_coordinates)
    .map(divide_results)
    .flat()
    .filter(is_cached)


var msgs = [];
while(msg.payload.length) {
    var temp = {payload:(msg.payload).splice(0, 500), measurement:"OpenAQ"}
    msgs.push(temp)
}


if(msgs.length !== 0 || flow.get("QueueSize") != 0) {
    flow.set("QueueSize", flow.get("QueueSize") + msgs.length)
    return [ msgs ];
} else {
    // check to make sure that the queue does not have nothing in it.
    // If nothing ever goes through it, then no new calls to OpenAQ will be made
    msg.payload = "nothing"
    return msg;
}

